import React, { Component } from 'react';
import { useSpring, animated } from "@react-spring/web";

const styles = useSpring({
    loop:true,
    from: { rotateZ: 0 },
    to: { rotateZ: 360 },
  });
class Homeb1 extends Component {
    render() {
        return (
            <div className='bg-black col-span-12 pb-40 w-full grid grid-cols-12 grid-rows-6 justify-items-center content-center z-10 h-screen max-w-screen-xl'>
                <div className=' col-start-3 col-end-11 row-span-3   grid justify-center content-center  w-3/5' >
                    <img src="/img/wlogo.png" alt="" />
                </div>

                <div className='col-span-12 row-span-3 w-full grid  content-center h-4/5 place-self-center' >
                   <div className='grid justify-center content-center text-7xl font-extrabold text-white text-center'>
                        <h1>WE BUILD TECH TO MAKE ART MORE ACCESSIBLE</h1> 
                    </div>

                </div>
                <animated.div
      style={{
        width: 80,
        height: 80,
        backgroundColor: '#46e891',
        borderRadius: 16,
        ...styles,
      }}
    >
                <div className='grid col-end-12 col-span-1 row-span-1 '> 
                    <h1 className="grid  justify-center content-center text-7xl font-extralight text-white">+</h1>
                </div>
              </animated.div>  

            </div>
        );
    }
}

export default Homeb1;
